import React from 'react'
import { 
    Card,

    CardImg, 
    CardText,
     CardBody,
    CardTitle, 
    CardSubtitle,
     Button
} from 'reactstrap'



export default function Cards(props){

    const {image, body , name } = props

    return(
        <Card>
            <CardImg top width="100%" src={`../public/images/${image}`}
            />

    

    <CardBody>
         <CardTitle>{name}</CardTitle>
         <CardText>
             {body}
         </CardText>
    </CardBody>
        </Card>
    )


}
